import React from 'react';
import { ListGroup } from 'react-bootstrap';

export default function Car (props){
  return(

    <div>
    <ListGroup horizontal>
      <ListGroup.Item>Regnummer.</ListGroup.Item>
      <ListGroup.Item>VehicleId</ListGroup.Item>
      <ListGroup.Item>Parkerad</ListGroup.Item>

      {props.carList.map(c => 
      <div>
        <ListGroup.Item>{c.regNr}</ListGroup.Item>
        <ListGroup.Item>{c.vehicleId}</ListGroup.Item>
        <ListGroup.Item>{c.parked ? "Yes" : "No"}</ListGroup.Item>
      </div>
      )}
    
    </ListGroup>
    </div>
  )
}
